import { Link } from "react-router-dom";

const Navbar = () => {
    return (
        <div className="navbar">
            <h2>The React Demos</h2>
            <div className="links">
                <a href="/Hello">Hello</a>
                <a href="/sdc">State Demo</a>
                <a href="/edc">Event Demo</a>
            </div>
        </div>
    )
}

export default Navbar;
